methods.examples:
// gives permission for the special authenticated group to create jobs in the folder
folder('example-1') {
    authorization {
        permission('hudson.model.Item.Create:authenticated')
    }
}

// gives discover permission for the special anonymous user
folder('example-2') {
    authorization {
        permission('hudson.model.Item.Discover', 'anonymous')
    }
}

// gives all permissions to the special anonymous user
folder('example-3') {
    authorization {
        permissionAll('anonymous')
    }
}

// creates a custom config file from a file named acme/settings.json in the seed job's workspace
customConfigFile('acme-settings') {
    comment('Settings for ACME tools')
    content(readFileFromWorkspace('acme/settings.json'))
}

folder('project-a') {
    displayName('Project A')
    description('Folder for project A')
}

folder('project-a/testing') {
    description('Folder containing all QA jobs for project A')
}

// creates a Maven settings file from a file named maven/settings.xml in the seed job's workspace
customConfigFile('company-settings') {
    comment('Company Maven Settings')
    content(readFileFromWorkspace('maven/settings.xml'))
}

def example1 = job('example-1') {
    displayName('first example')
}

queue(example1)

job('example-2') {
    displayName('second example')
}

queue('example-2')

// read the file foo/bar.txt from the seed job's workspace
def bar = readFileFromWorkspace('foo/bar.txt')

// read the file acme.xml from a workspace of job project-a
def acme = readFileFromWorkspace('project-a', 'acme.xml')
